    state = {
        books: BOOKS,
    };

    render() {

        const books = this.state.books.map((book) => {
            return <Seminew book={book} key={book.id} />
        });
        return (
            <div className='allsemibooks' >

                <CardColumns> {books} </CardColumns>





            </div>
        )

    }

}

